import Abilities from './Abilities'
import Held from './Held'

const Pokemon = ({ pokemon }) => {

    return (
        <div>
            <Abilities abilities={pokemon.abilities} />
            <Held held={pokemon.held}/>
        </div>
    )
}

export default Pokemon
